import './ShopHeader.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCartShopping} from '@fortawesome/free-solid-svg-icons';
import { faSearch } from '@fortawesome/free-solid-svg-icons';

function ShopHeader()  {
  return(

    <div className="shop-header">
      <form action="#">
                <input type="text" placeholder="Search Courses" name="search"></input>
                <button>
                  <FontAwesomeIcon className="cart-icon" icon={faSearch} />
                </button>
            </form>
      <p>Shop</p>
      <button className="cart-button"><FontAwesomeIcon className="cart-icon" icon={faCartShopping} /></button>
    </div>

  );
}

export default ShopHeader
